    playbackData.comments = {"794d9b37-25d0-4d6b-9688-9975474ce5ce":[{"id":"33ed9512-3e1c-47e9-9c08-74cc20251821","displayCommentEventId":"794d9b37-25d0-4d6b-9688-9975474ce5ce","displayCommentEventSequenceNumber":0,"developerGroupId":"5c9ec9ae-eb36-4bc5-b0f9-d85d94cf4e51","timestamp":1698696802598,"commentText":"A short playback discussing the difference in passing my reference and passing by value via a shuffling function.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"8bd945f5-a98f-4bd8-953c-3b550aca3184":[{"id":"52b742c6-1961-49e7-aee4-967b26d4ce90","displayCommentEventId":"8bd945f5-a98f-4bd8-953c-3b550aca3184","displayCommentEventSequenceNumber":331,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698726491466,"commentText":"In this program, we create a short list of numbers in order to fully visualize our process.&nbsp; Because a vector is a relatively complicated data type, <span style=\"font-family: Courier;\">cout</span> does not know how to print a vector (i.e. something like <span style=\"font-family: Courier;\">cout &lt;&lt; nums </span>will not work).&nbsp; We therefore create the function <span style=\"font-family: Courier;\">print_vec </span>to teach the computer how we would like the contents of the vector printed.&nbsp;&nbsp;<div><br></div><div>When we call <span style=\"font-family: Courier;\">print_vec,</span> we pass <span style=\"font-family: Courier;\">nums </span>to the function as an argument.&nbsp; When <span style=\"font-family: Courier;\">print_vec</span> receives the vector <span style=\"font-family: Courier;\">nums</span>, it immediately creates a copy, called <span style=\"font-family: Courier;\">v</span>, that has the exact same values as <span style=\"font-family: Courier;\">nums.</span>&nbsp; The visual below shows this.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"dccb2e60-7e91-4c44-ab4a-4e68f2b655df","selectedText":" vector <int> nums = {1,2,3,4,5,6,7,8,9};\n    print_vec(nums);\n","startRow":16,"startColumn":3,"endRow":18,"endColumn":0}],"imageURLs":["media/images/1698726871531-copy1.png"],"videoURLs":[],"audioURLs":[],"linesAbove":10,"linesBelow":2,"currentFilePath":"/main.cpp","viewableBlogText":"void print_vec(vector <int> v)\n{\n    for(int i = 0; i < v.size();i++)\n    {\n        cout << v[i] << ' ';\n    }\n    cout << endl;\n}\nint main()\n{\n    vector <int> nums = {1,2,3,4,5,6,7,8,9};\n    print_vec(nums);\n\n    return 0;\n}","commentTags":["image"],"questionCommentData":null}],"8a899959-264c-4710-8160-8195e4aadf27":[{"id":"3c7d7b98-cc78-4148-beb1-b51b4ea50c86","displayCommentEventId":"8a899959-264c-4710-8160-8195e4aadf27","displayCommentEventSequenceNumber":390,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698727010488,"commentText":"The algorithm module has a <span style=\"font-family: Courier;\">random_shuffle</span> function that can \"shuffle\" elements in a list.&nbsp; The two arguments we must pass to the function are the starting and ending points of the list we want shuffled, which we can obtain using our vector's<span style=\"font-family: Courier;\"> .begin()</span> and <span style=\"font-family: Courier;\">.end()</span> methods.","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"dccb2e60-7e91-4c44-ab4a-4e68f2b655df","selectedText":"random_shuffle(nums.begin(),nums.end());","startRow":19,"startColumn":4,"endRow":19,"endColumn":44}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"    random_shuffle(nums.begin(),nums.end());","commentTags":[],"questionCommentData":null}],"fea182b6-a37b-4db5-9e6a-dec15cab58c6":[{"id":"5de39b45-0a52-43c6-80a4-fb68db5d0992","displayCommentEventId":"fea182b6-a37b-4db5-9e6a-dec15cab58c6","displayCommentEventSequenceNumber":413,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698727215575,"commentText":"We can again call our <span style=\"font-family: Courier;\">print_vec </span>function to print the new contents of the <span style=\"font-family: Courier;\">nums</span> vector.&nbsp; The output is shown in the image below, so we can see that the contents of the <span style=\"font-family: Courier;\">nums</span> vector have actually been shuffled.&nbsp; While <span style=\"font-family: Courier;\">nums[0]</span> began as 1, <span style=\"font-family: Courier;\">nums[0]</span> is now 6, for example.<div><br></div><div>Computers, however, are not built for randomness; they thrive on procedure and being told exactly what to do (the opposite of randomness).&nbsp; The process for shuffling a vector may appear random at first, but if we run the code exactly as is repeatedly the output will ALWAYS be the same (6 1 8 2 5 7 3 9 4).&nbsp;&nbsp;</div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"dccb2e60-7e91-4c44-ab4a-4e68f2b655df","selectedText":"  random_shuffle(nums.begin(),nums.end());\n    print_vec(nums);","startRow":19,"startColumn":2,"endRow":20,"endColumn":20}],"imageURLs":["media/images/1698727092715-shuffle1.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":5,"linesBelow":2,"currentFilePath":"/main.cpp","viewableBlogText":"int main()\n{\n    vector <int> nums = {1,2,3,4,5,6,7,8,9};\n    print_vec(nums);\n\n    random_shuffle(nums.begin(),nums.end());\n    print_vec(nums);\n    return 0;\n}","commentTags":["image"],"questionCommentData":null}],"81e6cb46-5a58-4595-a699-1ba08d7fafb5":[{"id":"72d5bc4c-424b-40a2-93ea-7c3122a4382c","displayCommentEventId":"81e6cb46-5a58-4595-a699-1ba08d7fafb5","displayCommentEventSequenceNumber":457,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698727564809,"commentText":"We therefore create pseudo random numbers with the computer by seeding our random number generator as we have seen before, with the time since the \"epoch\".&nbsp; Note that seeding the random number generator makes it so that we get different outputs from <span style=\"font-family: Courier;\">random_shuffle</span> each time we run&nbsp; our program.&nbsp; A different example shuffle is shown in the image below.","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"dccb2e60-7e91-4c44-ab4a-4e68f2b655df","selectedText":" srand(time(NULL));","startRow":17,"startColumn":3,"endRow":17,"endColumn":22}],"imageURLs":["media/images/1698727561945-shuffle2.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":7,"currentFilePath":"/main.cpp","viewableBlogText":"int main()\n{\n    srand(time(NULL));\n    vector <int> nums = {1,2,3,4,5,6,7,8,9};\n    print_vec(nums);\n\n    random_shuffle(nums.begin(),nums.end());\n    print_vec(nums);\n    return 0;\n}","commentTags":["image"],"questionCommentData":null}],"6ab8e620-e704-48aa-a913-180f2a992301":[{"id":"05a25082-dc6b-4955-9a53-6a439c862638","displayCommentEventId":"6ab8e620-e704-48aa-a913-180f2a992301","displayCommentEventSequenceNumber":459,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698833322731,"commentText":"How does the algorithm function randomly shuffle our vector?&nbsp; To be honest, I'm not 100% sure, but I do know that we can write a shuffling function ourselves that isn't very difficult.&nbsp; Our goal is to create a function that shuffles a vector where we can see how the shuffle occurs.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"95be1703-1bfd-462c-9154-b7cfb62e9a75":[{"id":"7c808d91-fb14-4fe5-b948-a9ae63c587b4","displayCommentEventId":"95be1703-1bfd-462c-9154-b7cfb62e9a75","displayCommentEventSequenceNumber":840,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698834278998,"commentText":"We create a function, here called <span style=\"font-family: Courier;\">shuffle</span>, that takes in a vector of integers called <span style=\"font-family: Courier;\">nums</span> as a parameter.&nbsp; Our shuffling algorithm works by picking two elements of our vector at random and switching their positions.&nbsp; We then repeat this random swapping some large number of times until the outcome appears sufficiently random.&nbsp; It should remind you a bit of a shell game (image shown below) with more cups.<div><br></div><div>We also create a global constant named <span style=\"font-family: Courier;\">NUM_SWAPS</span> to keep track of how many times we wish to swap to avoid \"magic numbers\" in our code.&nbsp; &nbsp;Here, lines 23 and 24 pick random numbers using the <span style=\"font-family: Courier;\">rand()</span> function and mod those numbers ( using the <span style=\"font-family: Courier;\">%</span> operator) by the number of elements in our vector (<span style=\"font-family: Courier;\">nums.size()</span>) in order to pick a random number that corresponds to a position in our vector.&nbsp;&nbsp;</div><div><br></div><div>Because these random selections are made independently of one another, it <span style=\"font-weight: bold;\">is</span> possible that the values of <span style=\"font-family: Courier;\">pos1</span> and <span style=\"font-family: Courier;\">pos2</span> are the same (I can't resist saying there is a 1 in <span style=\"font-family: Courier;\">nums.size()</span> chance that they are the same).&nbsp; Because swapping in that situation does not make sense, we only perform the swap of <span style=\"font-family: Courier;\">nums[pos1]</span> and <span style=\"font-family: Courier;\">nums[pos2] </span>if the two positions are actually different.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"dccb2e60-7e91-4c44-ab4a-4e68f2b655df","selectedText":"void shuffle(vector <int> nums)\n{\n    for(int i = 0; i < NUM_SWAPS;i++)\n    {\n       int pos1 = rand() % nums.size();\n        int pos2 = rand() % nums.size();\n        if(pos1 != pos2)\n        {\n            swap(nums[pos1],nums[pos2]);\n        }\n    }\n\n}","startRow":18,"startColumn":0,"endRow":30,"endColumn":1}],"imageURLs":["media/images/1698833534648-shellGame.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":11,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"const int NUM_SWAPS = 100;\n\nvoid print_vec(vector <int> v)\n{\n    for(int i = 0; i < v.size();i++)\n    {\n        cout << v[i] << ' ';\n    }\n    cout << endl;\n}\n\nvoid shuffle(vector <int> nums)\n{\n    for(int i = 0; i < NUM_SWAPS;i++)\n    {\n       int pos1 = rand() % nums.size();\n        int pos2 = rand() % nums.size();\n        if(pos1 != pos2)\n        {\n            swap(nums[pos1],nums[pos2]);\n        }\n    }\n\n}","commentTags":["image"],"questionCommentData":null}],"d8567750-ba65-4e2a-ab3d-3d05c80d2623":[{"id":"8429a53f-9da2-476e-a22e-cf089573a132","displayCommentEventId":"d8567750-ba65-4e2a-ab3d-3d05c80d2623","displayCommentEventSequenceNumber":862,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698834438199,"commentText":"","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"dccb2e60-7e91-4c44-ab4a-4e68f2b655df","selectedText":" shuffle(nums);","startRow":38,"startColumn":3,"endRow":38,"endColumn":18}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"    shuffle(nums);","commentTags":["question"],"questionCommentData":{"allAnswers":["When we call shuffle(nums), we will see output that appears random to us, like 8 6 7 5 3 1 9 4 2 ","When we call shuffle(nums), we will see the output 1 2 3 4 5 6 7 8 9 "],"correctAnswer":"When we call shuffle(nums), we will see the output 1 2 3 4 5 6 7 8 9 ","question":"Which of the following seems more likely to you?","explanation":""}},{"id":"65e61b2b-a14d-474e-ae9c-6a5b9fcf6e38","displayCommentEventId":"d8567750-ba65-4e2a-ab3d-3d05c80d2623","displayCommentEventSequenceNumber":862,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698834790141,"commentText":"No matter how many times we call shuffle at this point, we will always see the output 1 2 3 4 5 6 7 8 9, as shown in the first image below.&nbsp; Why?<div><br></div><div>Remember how our<span style=\"font-family: Courier;\"> print_vec</span> function worked.&nbsp; When we passed it an argument, it created a copy of that argument and named it according to the parameter name (there, <span style=\"font-family: Courier;\">nums</span> was the argument and <span style=\"font-family: Courier;\">v</span> was the parameter).&nbsp; Even though I've named both the argument and parameter the same name, the computer makes a copy of the argument regardless.&nbsp; The second image below shows what the computer does.<br><div><br></div><div><br></div></div>","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":["media/images/1698834566501-shuffle3.PNG","media/images/1698834787695-copy2.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"","commentTags":["image"],"questionCommentData":null},{"id":"6130b927-76d9-4844-a74b-90f3735683f5","displayCommentEventId":"d8567750-ba65-4e2a-ab3d-3d05c80d2623","displayCommentEventSequenceNumber":862,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698835931480,"commentText":"Unless we tell it otherwise, functions will always make a copy of the data we hand it, <span style=\"font-style: italic;\">even if we hand it things of the same name</span>. This default action of the computer is called <span style=\"font-style: italic;\">passing (variables) by reference, </span>and it is generally a good thing since it means that data is preserved.<div><br></div><div>When variables are passed by reference, actions of the function are made to the<span style=\"font-style: italic;\"> copy</span> of the data.&nbsp; Therefore the shuffling action we previous described <span style=\"font-weight: bold;\">is</span> performed, it is just performed on the COPY of the data we passed it, as shown in the image below.<div><br></div><div>Because the variables used in a function only exist during the block of code where they are defined, the parameter version of <span style=\"font-family: Courier;\">nums</span> has been erased from memory when the flow of control returns to main after line 39.&nbsp; When we call the <span style=\"font-family: Courier;\">print_vec</span> function in line 40, we pass the original <span style=\"font-family: Courier;\">nums</span> to the <span style=\"font-family: Courier;\">print_vec</span> function; that is, vector still in its original order.&nbsp;</div></div>","commentTitle":"","position":2,"selectedCodeBlocks":[{"fileId":"dccb2e60-7e91-4c44-ab4a-4e68f2b655df","selectedText":"    shuffle(nums);","startRow":38,"startColumn":0,"endRow":38,"endColumn":18}],"imageURLs":["media/images/1698836208229-copy4.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"    shuffle(nums);","commentTags":["image"],"questionCommentData":null}],"4f402ec1-f849-42ce-8e30-ad76ed7afec3":[{"id":"5548ff06-9765-4167-a569-75c68b5239c9","displayCommentEventId":"4f402ec1-f849-42ce-8e30-ad76ed7afec3","displayCommentEventSequenceNumber":974,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698836638225,"commentText":"One solution to our problem is to change our <span style=\"font-family: Courier;\">void</span> function to a value returning function. That is, go ahead and create the copy of <span style=\"font-family: Courier;\">nums</span> when we create our <span style=\"font-family: Courier;\">shuffle</span> function, and shuffle that copy.&nbsp; But now add a <span style=\"font-family: Courier;\">return</span> statement to the end of the function so that we pass the copied version of <span style=\"font-family: Courier;\">nums</span>, the one that has been shuffled, back to <span style=\"font-family: Courier;\">main </span>when we are done with it.&nbsp; If we store this value in a new vector of integers called <span style=\"font-family: Courier;\">shuffled,</span> we can access the shuffled values.&nbsp; The picture below shows this.","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"dccb2e60-7e91-4c44-ab4a-4e68f2b655df","selectedText":"    vector <int> shuffled = shuffle(nums);","startRow":38,"startColumn":0,"endRow":38,"endColumn":42}],"imageURLs":["media/images/1698836730143-copy5.png"],"videoURLs":[],"audioURLs":[],"linesAbove":20,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"vector <int> shuffle(vector <int> nums)\n{\n    for(int i = 0; i < NUM_SWAPS;i++)\n    {\n        int pos1 = rand() % nums.size();\n        int pos2 = rand() % nums.size();\n        if(pos1 != pos2)\n        {\n            swap(nums[pos1],nums[pos2]);\n        }\n    }\n    return nums;\n}\nint main()\n{\n    srand(time(NULL));\n    vector <int> nums = {1,2,3,4,5,6,7,8,9};\n    print_vec(nums);\n\n    //random_shuffle(nums.begin(),nums.end());\n    vector <int> shuffled = shuffle(nums);","commentTags":["image"],"questionCommentData":null}],"21a25c3e-fb27-4971-9db9-2012cadafb11":[{"id":"c5e03df1-0021-4bfb-bad6-5ec7c13048e0","displayCommentEventId":"21a25c3e-fb27-4971-9db9-2012cadafb11","displayCommentEventSequenceNumber":1026,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698836843377,"commentText":"","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"dccb2e60-7e91-4c44-ab4a-4e68f2b655df","selectedText":"   vector <int> shuffled = shuffle(nums);\n    print_vec(shuffled);","startRow":39,"startColumn":1,"endRow":40,"endColumn":24}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"    vector <int> shuffled = shuffle(nums);\n    print_vec(shuffled);","commentTags":["question"],"questionCommentData":{"allAnswers":["8 6 7 5 3 1 9 4 2","1 2 3 4 5 6 7 8 9 "],"correctAnswer":"8 6 7 5 3 1 9 4 2","question":"Which would be printed to the console with our running example via the print statement in line 41?","explanation":""}}],"442f7f8f-bff2-4f32-a2bf-a1d45ac5203b":[{"id":"69200637-c420-439e-892a-21c76e90c5ca","displayCommentEventId":"442f7f8f-bff2-4f32-a2bf-a1d45ac5203b","displayCommentEventSequenceNumber":1074,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698836894188,"commentText":"Let's suppose, however, that we truly want to mimic the <span style=\"font-family: Courier;\">random_shuffle()</span> function, which was a <span style=\"font-family: Courier;\">void</span> function that actually changed the values in my vector.&nbsp; Is there a way to make this happen?","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"dccb2e60-7e91-4c44-ab4a-4e68f2b655df","selectedText":"   shuffle(nums);\n    print_vec(nums);","startRow":41,"startColumn":1,"endRow":42,"endColumn":20}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"    shuffle(nums);\n    print_vec(nums);","commentTags":[],"questionCommentData":null}],"3a479166-60a5-4287-830d-5bd6a74bfe14":[{"id":"8b6f4aa9-5bf4-4e4b-834c-489465f3c28c","displayCommentEventId":"3a479166-60a5-4287-830d-5bd6a74bfe14","displayCommentEventSequenceNumber":1115,"developerGroupId":"1519e139-a52f-4bc1-94f6-cc9b9d680d49","timestamp":1698837486750,"commentText":"There is a different way to pass arguments in C++ called <span style=\"font-style: italic;\">passing by value.</span>&nbsp; This is where we tell the computer not to create a copy of our variable but to simply create a different name/alias for that actual value that goes by the parameter name.&nbsp; In order to signify to the computer that we would like to pass a variable by value, we place a single <span style=\"font-family: Courier;\">&amp;</span> after the data type of the parameter, as shown on line 19.&nbsp; A way to visualize this is shown in the image below.<div><br></div><div>You can visualize the difference between passing by value and passing by reference as the difference between sharing a Google doc and making a photocopy of a physical piece of paper.&nbsp; When you share a Google doc, you give someone the power to actually change your original document; this is passing by value.&nbsp; When you make a photocopy of your original work and hand it to someone, they can't change your original document; this is passing by reference.&nbsp; The latter is safer, so it is the default, but there are times you actually want someone to be able to change something.</div><div><br></div><div>A big benefit of passing by value is that it saves time and space in memory when data types are sufficiently complicated or data is particularly large.&nbsp; In the value returning version of this problem, we always had three copies of the same thing existing in memory!&nbsp; All the copying of these lists over and over again eventually takes time, and it would take more and more time the larger the list got.&nbsp; We therefore often pass by value when things are either complicated, large, or we trust the function not to tamper with our data.&nbsp; We pass by reference for more primitive data types or when it is very important to preserve the integrity of our data.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"dccb2e60-7e91-4c44-ab4a-4e68f2b655df","selectedText":"void shuffle(vector <int>& nums)","startRow":18,"startColumn":0,"endRow":18,"endColumn":32}],"imageURLs":["media/images/1698837189178-value1.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"void shuffle(vector <int>& nums)","commentTags":["image"],"questionCommentData":null}]};
